import React from 'react';
import './navbar.css'; // Import file CSS untuk styling
import LogoNgonser from './img/ngonserlogo.png'
import masuk from './img/masuk.png'
import daftar from './img/daftar.png'

class Karya extends React.Component {
    render() {
        return (
            <div>
                <h2>Ini karya saya sebagai UI/UX</h2>
            </div>
        );
    }
}

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-logo">
                <img src={LogoNgonser}/>
            </div>
            <div className="navbar-search">
                <input type="text" placeholder="" />
                <button type="submit">Search</button>
            </div>
            <div className="navbar-links">
                <a href="#">Kontak</a>
                <a href="#">Tentang Kami</a>
                <a href="#"><img src={masuk} height={30} /></a>
                <a href="#"><img src={daftar} height={30} /></a>
            </div>
        </nav>
    );
};

export default Navbar;
